import Overview from "./Overview";
import Repositories from "./Repositories";
import Projects from "./Projects";

const Navbar = () => {
    return (

        
            <nav style={{ marginRight: '130px' }} className=" flex justify-center  z-20 lg:mb-0 lg:mt-0 lg:flex-row lg:items-center">
                <Overview />
                <Repositories />
                <Projects />
            </nav>
        

    )
}
export default Navbar;
